import React from 'react';
import { Link } from 'react-router-dom';
import logo from '../../assets/bear.png';
import contactImg from '../../assets/heart.png';
import './navbar.css';

const Navbar = () => {
    return(
        <nav className="navbar">
            <img src={logo} alt="Logo" className="logo" />
            <div className="desktopMenu">
                <Link to = "/app.js">Home </Link>
            </div>
            <div>
                <Link to = "/">About</Link>
            </div>
                <Link className="dekstopMenuListItem">Subjects</Link>
                <Link className="dekstopMenuListItem">Projects</Link>

            <button className="desktopMenuButton">
                <img src={contactImg} alt = "contactImg" className="desktopMenuImg" />Contact me</button>
        </nav>
    )
}

export default Navbar;
